import React from "react";
import { View, Text } from "react-native";
import { style } from "../stylesheets/usermenustyle";
import { useState } from "react";

export default function UserMenu({isVisible} : any) {

    if(isVisible) {
        return (
            <View style={style.content}>
                <View>
                <Text>Profile</Text>
                </View>
                <View>
                <Text>Programs</Text>
                </View>
                <View>
                <Text>Diets</Text>
                </View>
                <View>
                <Text>Stats</Text>
                </View>
            </View>
        )
    }
}
